import React, { useState } from "react";

import {
  Card,
  Row,
  Col,
  Typography,
  // Input,
  Form,
  // Radio,
  // Select,
  // Tooltip,
  // DatePicker,
  // Button,
  // Table,
} from "antd";

//Card title
const { Title } = Typography;

//from on finish

const onFinish = (values) => {
  console.log("Received values of form: ", values);
};
const onFinishFailed = (errorInfo: any) => {
  console.log("Failed:", errorInfo);
};

function App() {
  return (
    <div className="App">
      <>
        <Row justify="center">
          <Col>
            <Card style={{ width: "100VW", height: 100 }}>
              <Title level={1}>Register Form</Title>
            </Card>
          </Col>
        </Row>
        <br />
        <br />
        <Row justify="center">
          <Col span={24}>
            <Form
              name="basic"
              labelCol={{
                span: 10,
              }}
              wrapperCol={{
                span: 6,
              }}
              initialValues={{
                remember: true,
              }}
              onFinish={onFinish}
              onFinishFailed={onFinishFailed}
              validateMessages={validateMessages}
              autoComplete="off"
            ></Form>
          </Col>
        </Row>
      </>
    </div>
  );
}

export default App;
